import React, { useState, useEffect } from 'react';
import axios from 'axios';

const TableHeaderCell = ({ value }) => {
  return (
    <th scope="col" className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
      {value}
    </th>
  );
};

const TableDataCell = ({ value }) => {
  return (
    <td className="px-6 py-4 whitespace-nowrap">
      {value}
    </td>
  );
};

export const ProjectList = () => {


  const [data, setData] = useState([]);

  useEffect(() => {
    axios.get('https://prod-server.xquare.app/project-secret-manager/project?secret=xquare-helloworld')
      .then((res) => {setData(res.data)})
      .catch((err) => console.error(err));
  }, []);

  // const [secret, setSecret] = useState('');

  // useEffect(() => {
  //   const currentURL = new URL(window.location.href);
  //   const searchParams = currentURL.searchParams;
  //   setSecret(searchParams.get('secret'))
  // }, []);

  // if (process.env.get("SECRET") != secret) return (<></>);

  return (
    <div className="bg-gray-100 p-4">
      <h1 className="text-2xl font-bold mb-4">등록된 프로젝트 목록</h1>
      <table className="min-w-full divide-y divide-gray-200">
        <thead className="bg-gray-50">
          <tr>
            <TableHeaderCell value="이름" />
            <TableHeaderCell value="영어이름" />
            <TableHeaderCell value="Repository" />
            <TableHeaderCell value="Type" />
            <TableHeaderCell value="Created At" />
            <TableHeaderCell value="Last Used At" />
            <TableHeaderCell value="Last Request Succeed" />
            <TableHeaderCell value="Club" />
            <TableHeaderCell value="Use Redis" />
            <TableHeaderCell value="Use MySQL" />
          </tr>
        </thead>
        <tbody className="bg-white divide-y divide-gray-200">
          {data.map((item) => (
            <tr key={item.id}>
              <TableDataCell value={item.nameKo} />
              <TableDataCell value={item.nameEn} />
              <TableDataCell value={item.repository} />
              <TableDataCell value={item.type} />
              <TableDataCell value={item.createAt} />
              <TableDataCell value={item.lastUsedAt} />
              <TableDataCell value={item.lastRequestSucceed ? 'Yes' : 'No'} />
              <TableDataCell value={item.club} />
              <TableDataCell value={item.useRedis ? 'Yes' : 'No'} />
              <TableDataCell value={item.useMySQL ? 'Yes' : 'No'} />
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
